import React from 'react';

import CollectionsPreview from '../../components/collections/CollectionsPreview';

const Shop = ({ collections }) => {
  return (
    <div>
      {collections.map(({ id, ...otherProps }) => (
        <CollectionsPreview key={id} {...otherProps} />
      ))}
    </div>
  );
};

export default Shop;
